--
-- Table structure for table `scores`
--

DROP TABLE IF EXISTS `scores`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `scores` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `score_type` enum('Фондовый счет','Срочный счет','Единый счет','MMA') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип счета',
  `trading_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Торговый код счета',
  `show_score` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'публичность счета',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время подключения счета',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  `summa` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `trading_code` (`trading_code`),
  KEY `scores_user_id_fk` (`user_id`),
  CONSTRAINT `scores_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Торговые счета';
/*!40101 SET character_set_client = @saved_cs_client */;

