--
-- Table structure for table `strategy`
--

DROP TABLE IF EXISTS `strategy`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `strategy` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int unsigned NOT NULL COMMENT 'Ссылка на пользователя - автора стратегии',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'название стратегии',
  `score_id` int unsigned NOT NULL COMMENT 'Ссылка на счет',
  `text_message` blob COMMENT 'описание стратегии',
  `statistics` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Статистика по стратегии',
  `min_summa` int unsigned NOT NULL COMMENT 'Минимальная рекоменованная сумма',
  `Profit` float NOT NULL DEFAULT '0' COMMENT 'доходность за весь срок',
  `prosadka` float NOT NULL DEFAULT '0' COMMENT 'Дата начала работы стратегии',
  `ita` float NOT NULL DEFAULT '0' COMMENT 'Индекс частоты сделок',
  `dopnik_avto_id` int unsigned NOT NULL COMMENT 'Ссылка на таблицу допников на автоследования',
  `avto_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Активна ли стратегия для подключения автоследования',
  `dopnik_signal_id` int unsigned NOT NULL COMMENT 'Ссылка на таблицу допников на сигналы',
  `signal_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Активна ли стратегия для подключения сигналов',
  `risk_profile` enum('Консервативный','Умеренный','Агрессивный') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Риск профиль',
  `begin_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата начала работы стратегии',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `strategy_dopnik_avto_fk` (`dopnik_avto_id`),
  KEY `strategy_dopnik_signal_fk` (`dopnik_signal_id`),
  KEY `strategy_scores_fk` (`score_id`),
  CONSTRAINT `strategy_dopnik_avto_fk` FOREIGN KEY (`dopnik_avto_id`) REFERENCES `dopnik_avto` (`id`),
  CONSTRAINT `strategy_dopnik_signal_fk` FOREIGN KEY (`dopnik_signal_id`) REFERENCES `dopnik_signal` (`id`),
  CONSTRAINT `strategy_scores_fk` FOREIGN KEY (`score_id`) REFERENCES `scores` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Список доп соглашений сигналов';
/*!40101 SET character_set_client = @saved_cs_client */;

