--
-- Final view structure for view `best_strategys`
--

/*!50001 DROP VIEW IF EXISTS `best_strategys`*/;
/*!50001 SET @saved_cs_client          = @@character_set_client */;
/*!50001 SET @saved_cs_results         = @@character_set_results */;
/*!50001 SET @saved_col_connection     = @@collation_connection */;
/*!50001 SET character_set_client      = utf8mb4 */;
/*!50001 SET character_set_results     = utf8mb4 */;
/*!50001 SET collation_connection      = utf8mb4_0900_ai_ci */;
/*!50001 CREATE ALGORITHM=UNDEFINED */
/*!50013 DEFINER=`root`@`localhost` SQL SECURITY DEFINER */
/*!50001 VIEW `best_strategys` AS select `strategy`.`name` AS `Название`,`strategy`.`Profit` AS `Profit`,`strategy`.`prosadka` AS `prosadka`,`strategy`.`risk_profile` AS `risk_profile`,`users`.`nik` AS `nik`,count(`clients_strategy`.`users_id`) AS `investors` from (((`strategy` left join `scores` on((`scores`.`id` = `strategy`.`score_id`))) left join `users` on((`users`.`id` = `scores`.`user_id`))) join `clients_strategy` on((`clients_strategy`.`strategy_id` = `strategy`.`id`))) group by `strategy`.`name` order by `strategy`.`Profit` desc,`investors` desc */;
/*!50001 SET character_set_client      = @saved_cs_client */;
/*!50001 SET character_set_results     = @saved_cs_results */;
/*!50001 SET collation_connection      = @saved_col_connection */;

